  `equipslot1` int(11) NOT NULL DEFAULT 0,
  `equipslot2` int(11) NOT NULL DEFAULT 0,
  `equipslot3` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`creatureID`,`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




